<template>
  <div class="go-udstream-div" v-if="displayCanvas">
    <div class="preview-header">
      <svg
        width="1331"
        height="70"
        viewBox="0 0 1331 70"
        fill="none"
        xmlns="http://www.w3.org/2000/svg"
        xmlns:xlink="http://www.w3.org/1999/xlink"
      >
        <rect x="0.0495605" width="1330.69" height="70" fill="url(#pattern0)" />
        <defs>
          <pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
            <use xlink:href="#image0_2075_710" transform="scale(0.000520833 0.00990099)" />
          </pattern>
          <image
            id="image0_2075_710"
            width="1920"
            height="101"
            xlink:href="data:image/png;base64,"
          />
        </defs>
      </svg>
      <label class="preview-header-name">{{ previewName }}</label>
    </div>
    <div class="menu-tree">
      <div class="zd-class" @click="zdOperate">
        <el-icon v-show="zdButtonShow"><DArrowLeft /></el-icon>
        <el-icon v-show="!zdButtonShow"><DArrowRight /></el-icon>
      </div>
      <el-menu
        v-if="zdButtonShow"
        :default-active="activeDaultPage"
        class="el-menu-vertical-demo"
        background-color="#4b91a0a1"
        active-text-color="#0C0B0B"
        @select="handleSelectPage"
      >
        <el-menu-item v-for="item in pageInfoList" :key="item.key" :index="item.key">
          <el-icon><Position /></el-icon>
          <span>{{ item.name }}</span>
        </el-menu-item>
      </el-menu>
    </div>
    <udstream-preview @no-webgl2="noWebGL2 = true" @loaded="loading = false" />
  </div>
</template>
<script lang="ts" setup>
import { computed, ref, onBeforeMount, onMounted, watch } from "vue"
import UdstreamPreview from "./udstreamPreview.vue"
import { fethProjectApiWithEulee } from "@/api/euleeSource"
import { Position, DArrowLeft, DArrowRight } from "@element-plus/icons-vue"
import { fetchRouteProjectId } from "@/utils/router"
import { ElMessage, ElMessageBox } from "element-plus"
import * as udStream from "@/udStream/udStream"
import { ProjectNode } from "@/udStream/types/ProjectNode"
const runtimeError = ref(false)
const noWebGL2 = ref(false)
const loading = ref(true)

const zdButtonShow = ref(true)

const activeDaultPage = ref("1")

const previewName = ref("")

const displayCanvas = computed(() => {
  return !noWebGL2.value && !runtimeError.value
})

const pageInfoList = ref([])
let allEventList = [] as any[]
let allPageJsonList = [] as any[]
let currentPageJson = null as any
const theProjectId = fetchRouteProjectId()
//选择某个页面需要进行的操作
const handleSelectPage = (key: string, keyPath: string[], item: any) => {
  const theIndex = item.index
  const thePageJson = allPageJsonList[theIndex - 1]
  currentPageJson = allPageJsonList[theIndex - 1]
  if (thePageJson.udjson) {
    udStream.loadSceneJson(JSON.stringify(thePageJson.udjson))
  }

  if (thePageJson.udsetting) {
    udStream.saveSettings(thePageJson.udsetting)
  }
}

//不同页面间通过传入的事件进行跳转
const handleEventByPageId = (pageId: any) => {
  let pageIndex = 0
  const thePageJson = allPageJsonList.find((item, index) => {
    if (item.id === pageId) {
      pageIndex = index
      return item
    }
  })

  activeDaultPage.value = (pageIndex + 1).toString()
  if (thePageJson.udjson) {
    udStream.loadSceneJson(JSON.stringify(thePageJson.udjson))
  }

  if (thePageJson.udsetting) {
    udStream.saveSettings(thePageJson.udsetting)
  }
}

const buildPageTabs = (params: any) => {
  if (params && params.length > 0) {
    pageInfoList.value = params.reduce((pre: any, cur: any, index: number) => {
      const pageKey = index + 1
      const itemData = {
        name: cur.name,
        id: cur.id,
        key: pageKey.toString()
      }
      pre.push(itemData)
      return pre
    }, [])
  }
}

const zdOperate = () => {
  zdButtonShow.value = !zdButtonShow.value
}

//如果是跳转的页面  可以从localstrorage中获取
const fetchProject = () => {
  const project_formData = new FormData()
  project_formData.append("project_id", parseFloat(theProjectId).toString())
  const windowUrl = document.location.hash.split("?").pop() || ""
  if (windowUrl) {
    const splitParas = windowUrl.split("=")
    if (splitParas.length > 1) {
      const organizationStr = splitParas[1]
      //如果传入了组织机构
      project_formData.append("group_id", organizationStr) //这个groupId  应该从项目里面获取到才对
    } else {
      project_formData.append("group_id", "0") //这个groupId  应该从项目里面获取到才对
    }
  } else {
    project_formData.append("group_id", "0") //这个groupId  应该从项目里面获取到才对
  }
  fethProjectApiWithEulee(project_formData)
    .then((res: any) => {
      if (res.data.json_content && res.data.json_content.json_content) {
        // 将项目的json_content 保存到localstrorage
        // localStorage.setItem("udstreamPageListPreview", res.data.json_content.json_content)
        // 以字符串的形式加载场景
        const json_content = JSON.parse(res.data.json_content.json_content)
        allPageJsonList = json_content
        buildPageTabs(json_content) //新建tabs
        currentPageJson = json_content[0]
        if (json_content[0].udjson) {
          setTimeout(() => {
            udStream.loadSceneJson(JSON.stringify(json_content[0].udjson))
            if (json_content[0].cameraCenterUUID) {
              // 设置相机位置
              const cameraCenterUUID = json_content[0].cameraCenterUUID
              udStream.moveToWhenPossible(cameraCenterUUID)
            }
          }, 2000)
        }
        //页面的信息
        if (json_content[0].name) {
          console.log("do nothing")
          // pageInfoStore.setItem(PageStoreEnums.PAGE_INFO, { name: json_content[0].name, id: json_content[0].id }) //当前第一个页面的信息
        }

        //更改页面相关的设置
        if (json_content[0].udsetting && Reflect.ownKeys(json_content[0].udsetting).length > 0) {
          udStream.saveSettings(json_content[0].udsetting)
        } else {
          udStream.getSettings().then((settings) => {
            settings.maptiles.demEnabled = false
            settings.pointMode = 1 // 点=>2
            settings.tools.label.backgroundColour = [0, 0, 0, 0.5] // 背景色
            udStream.saveSettings(settings)
          })
        }
      } else {
        ElMessage({
          message: "该场景还未被编辑，暂无内容可展示！",
          type: "info",
          duration: 3000
        })
      }

      //预览的名称
      if (res.data.json_content && res.data.json_content.name) {
        previewName.value = res.data.json_content.name
      }
    })
    .catch((err) => {
      console.log(err)
      ElMessage({
        message: "资源请求出错，请验证资源是否存在！",
        type: "error",
        duration: 0
      })
    })
}

//找到场景中对应的uudd
const findClickNodeUUID = (treeNodes: [] | undefined, uuid: string) => {
  if (treeNodes && treeNodes.length > 0) {
    for (let k = 0; k < treeNodes.length; k++) {
      if (treeNodes[k]?.data?.UUID == uuid) {
        findUdstreamNode = treeNodes[k]
      } else {
        if (treeNodes[k].children && treeNodes[k]?.children.length > 0) {
          findClickNodeUUID(treeNodes[k].children, uuid)
        }
      }
    }
  } else {
    return null
  }
}

//不同事件的操作
const differentEventOperate = (filterNode: any) => {
  //进行对应的事件操作
  let eventType = filterNode.customEvent
  let actionType = filterNode.action
  if (eventType == "roamTouch") {
    //漫游跳转  穿梭
    switch (actionType) {
      case "sceneTransition":
        //场景跳转
        ElMessageBox.confirm("是否进行不同页面间的跳转？", "场景转场", {
          confirmButtonText: "是",
          cancelButtonText: "否",
          type: "warning"
        })
          .then(() => {
            ElMessage({
              type: "success",
              message: "页面间跳转成功！"
            })
            handleEventByPageId(filterNode.viewPoint)
          })
          .catch(() => {
            ElMessage({
              type: "info",
              message: "取消了页面间的跳转!"
            })
          })
        break
      case "sceneJump":
        //当前页面跳转
        if (filterNode.viewPoint) {
          ElMessageBox.confirm("是否进行场景内部的跳转？", "当前场景跳转", {
            confirmButtonText: "是",
            cancelButtonText: "否",
            type: "warning"
          })
            .then(() => {
              ElMessage({
                type: "success",
                message: "场景跳转成功！"
              })
              udStream.moveToWhenPossible(filterNode.viewPoint)
            })
            .catch(() => {
              ElMessage({
                type: "info",
                message: "取消了场景内部的跳转!"
              })
            })
        }
        break
      default:
        break
    }
  }
}

let allTheTreeNodes = [] as any[]
let rootNode = null as any
onBeforeMount(() => {
  udStream.registerGetActiveProjectRootNodeCallback((rootNodePtr) => {
    try {
      rootNode = new ProjectNode(rootNodePtr)
    } catch (error) {
      console.log(error)
    }
  })
  udStream.registerUpdateProjectNodesCallback(() => {
    try {
      if (rootNode) {
        rootNode.checkUpdates()
      }
    } catch (error) {
      console.log(error)
    }
    // 这里还需要做其他的操作  不然节点不会变化............
  })
  udStream.registerGetClickedItemCallback((uuid, isMultiSelect) => {
    //照理要对目录树进行反选
    if (uuid) {
      console.log("点击了节点", uuid)
      if (currentPageJson && currentPageJson.udEvent && currentPageJson.udEvent.length > 0) {
        let filterNode = currentPageJson.udEvent.find((item: any) => {
          return item.uuid == uuid
        })
        console.log("filterNode", filterNode)
        if (filterNode) {
          differentEventOperate(filterNode)
        }
      }
    }
  })
})

onMounted(() => {
  window.onerror = function () {
    loading.value = false
    if (globalThis.Module) {
      globalThis.Module.setStatus("Exception thrown, see JavaScript console")
      globalThis.Module.setStatus = function (text) {
        if (text) {
          ElMessage({
            message: "udstream引擎报错，请刷新页面继续，或关闭页面后重新打开！",
            type: "error",
            duration: 0
          })
          console.error("[post-exception status] " + text)
          runtimeError.value = true
        }
      }
    }
  }
})

watch(loading, async (value) => {
  if (parseFloat(theProjectId).toString() == "NaN") {
    ElMessage.warning("路径中不含有项目ID,请返回优立云查看跳转路径！")
    return
  }
  fetchProject()
})
</script>
<style scoped>
.go-udstream-div {
  width: 100%;
  height: 100%;
}
.preview-header {
  position: fixed;
  z-index: 999;
  left: 50%;
  top: 0;
  transform: translateX(-50%);
}

.preview-header-name {
  position: absolute;
  left: 50%;
  top: 15px;
  transform: translateX(-50%);
  font-weight: bold;
  font-size: 20px;
}
.menu-tree {
  position: absolute;
  z-index: 3;
  top: 50%;
  left: 8px;
  transform: translateY(-50%);
}

.menu-tree :deep(.el-menu) {
  border: none;
  box-shadow: none;
  border-radius: 8px;
}
.zd-class {
  margin-bottom: 12px;
  width: 40px;
  height: 40px;
  background-color: #4b91a0a1;
  text-align: center;
  line-height: 40px;
  border-radius: 8px;
}
.zd-class:hover {
  cursor: pointer;
  background-color: #4b91a0;
}
</style>
